import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import Sidebar from './components/Sidebar';
import {BrowserRouter} from 'react-router-dom'
ReactDOM.render(
    <div>
        <BrowserRouter>
            <App/>,
        </BrowserRouter>
         <Sidebar/></div>   ,
    document.getElementById('root')
)
